syntax = "proto3";

import "PBBaseCommand.proto";

option java_package = "com.immomo.luanative.codec.protobuf";
option java_outer_classname = "PBEntryFileCommand";

message pbentryfilecommand {
    pbbasecommand basecommand = 1;
    string entryFilePath = 2;
    string relativeEntryFilePath = 3;
    string params = 4;
}